RE/AAQAAAERPwAEAAABET8ABAAAARE/AAQAAAERPwAEAAABET8ABAAAA\nRE/AAQAAAERPwAEAAABET8ABAAAARE/AAQAAAERPwAEAAABET8ABAAAARE/AAQAAAERPwAEA\nAABET8ABAAAARE/AAQAAAERPwAEAAABET8ABAAAARE/AAQAAAERPwAEAAABET8ABAAAARE/A\nAQAAAERPwAEAAABET8ABAAAARE/AAQAAAERPwAEAAABET8ABAAAARE/AAQAAAERPwAEAAABE\nT8ABAAAARE/AAQAAAERPwAEAAABET8ABAAAARE/AAQAAAERPwAEAAABET8ABAAAARE/AAQAA\nAERPwAEAAABET8ABAAAARE/AAQAAAERPwAEAAABET8ABAAAARE/AAQAAAERPwAEAAABET8AB\nAAAARE/AAQAAAERPwAEAAABET8ABAAAARE/AAQAAAERPwAEAAABET8ABAAAARE/AAQAAAERP\nwAEAAABET8ABAAAARE/AAQAAAERPwAEAAABET8ABAAAARE/AAQAAAERPwAEAAABET8ABAAAA\nRE/AAQAAAERPwAEAAABET8ABAAAARE/AAQAAAERPwAEAAABET8ABAAAARE/AAQAAAERPwAEA\nAABET8ABAAAARE/AAQAAAERPwAEAAABET8ABAAAARE/AAQAAAERPwAEAAABET8ABAAAARO//\nAbmuGsnR//8BAAAAAElFTkSuQmCC"},"metadata":{"image/png":{"width":720,"height":600}}}]},{"cell_type":"markdown","source":"# <div style=\"color:white;display:inline-block;border-radius:5px;background-color:#0000FF;font-family:Nexa;overflow:hidden\"><p style=\"padding:10px;color:white;overflow:hidden;font-size:100%;letter-spacing:0.5px;margin:0\"><b> </b> Commodity Analysis</p></div>\n\n\n* Analyze the pricing patterns of different commodities.\n* Identify commodities with the highest and lowest prices based on modal price.\n* Determine the average price range for each commodity.\n","metadata":{}},{"cell_type":"code","source":"# Example data for commodity patterns\ncommodity_patterns <- data.frame(\n  commodity = c(\"Commodity A\", \"Commodity B\", \"Commodity C\"),\n  avg_price = c(10, 15, 8)\n)\n\n# Identify commodities with the highest and lowest prices\nhighest_price <- commodity_patterns$commodity[which.max(commodity_patterns$avg_price)]\nlowest_price <- commodity_patterns$commodity[which.min(commodity_patterns$avg_price)]\n\n# Print the results\ncat(\"Commodities with the highest and lowest prices:\\n\")\nif (is.na(highest_price)) {\n  cat(\"Highest Price: No data available\\n\")\n} else {\n  cat(\"Highest Price: \", highest_price, \"\\n\")\n}\n\nif (is.na(lowest_price)) {\n  cat(\"Lowest Price: No data available\\n\")\n} else {\n  cat(\"Lowest Price: \", lowest_price, \"\\n\")\n}\n\ncat(\"\\n\")\n\ncat(\"Average Price Range for Each Commodity:\\n\")\nprint(commodity_patterns)\n\n# Visualization - Bar plot for average price range of each commodity\nlibrary(ggplot2)\nggplot(commodity_patterns, aes(x = commodity, y = avg_price)) +\n  geom_bar(stat = \"identity\", fill = \"steelblue\") +\n  labs(x = \"Commodity\", y = \"Average Modal Price\", title = \"Average Price Range of Commodities\") +\n  theme_minimal() +\n  theme(\n    axis.text.x = element_text(angle = 45, hjust = 1),\n    plot.title = element_text(size = 16, face = \"bold\"),\n    axis.title = element_text(size = 14)\n  )\n","metadata":{"execution":{"iopub.status.busy":"2023-07-12T02:27:00.970036Z","iopub.execute_input":"2023-07-12T02:27:00.973264Z","iopub.status.idle":"2023-07-12T02:27:01.317033Z"},"trusted":true},"execution_count":36,"outputs":[{"name":"stdout","text":"Commodities with the highest and lowest prices:\nHighest Price:  Commodity B \nLowest Price:  Commodity C \n\nAverage Price Range for Each Commodity:\n    commodity avg_price\n1 Commodity A        10\n2 Commodity B        15\n3 Commodity C         8\n","output_type":"stream"},{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAABaAAAASwCAIAAACCY3qwAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd3wUZf4H8NlsKiR0BAELihUVUSzoeVjw5CxnOdvZ9cR2Knd6Kj8Vy1mxICf2\nir2ch56KZz/FLhbsCiooIlUglEDq/v4IbJaQhGxICA++33/4mn3m2dnvlMWdT56ZiSUSiQgA\nAAAgZBnNXQAAAADAyhJwAAAAAMETcAAAAADBE3AAAAAAwRNwAAAAAMETcAAAAADBE3AAAAAA\nwRNwAAAAAMFbAwOOb+76bSxF/4e/be6KwrNhXlasJhkZGS1btevec4ejTrv49W/mprXMoul3\nJ5fTbbcXmqjy+ji6U36Na5e6jj137H/BzU+WJJqxzNXaLx899qf+23Vs1SKemZWX3+aID2fU\n/71fvfz4BX85ss8Wm3Tu0Dort6Bb94377vHHf4x48Os5xU1X8BojeaAWdD0j2Zjul2v1+TIC\nAEAjWgMDjpsvHZf68oMhI5upkDVQIpEomj9n0pfvP3TrP3bvuc4Zt3/U3BU1vsp1/PK9V648\n/aBN9760TMaxnNIFH2yz81GPvvLBrPmLKsrLFi8snFe/zbRo+psn7Lnp5nseduUtD3/4xfjp\nv8wrK14wZdKE