 It states that for any random variable, the probability that the variable differs from its mean by more than k standard deviations is at most 1/k^2. It is a useful tool for understanding the spread of data and making probabilistic statements.\n\n","metadata":{}},{"cell_type":"code","source":"# Calculate Chebyshev's inequality for 'modal_price'\nmean_price <- mean(data$modal_price)\nsd_price <- sd(data$modal_price)\nk <- 2 # Choose the number of standard deviations\nlower_bound <- mean_price - k * sd_price\nupper_bound <- mean_price + k * sd_price\nprop_outliers <- sum(data$modal_price < lower_bound | data$modal_price > upper_bound) / length(data$modal_price)\nprop_outliers\n","metadata":{"execution":{"iopub.status.busy":"2023-07-12T02:30:43.226427Z","iopub.execute_input":"2023-07-12T02:30:43.228178Z","iopub.status.idle":"2023-07-12T02:30:43.259947Z"},"trusted":true},"execution_count":42,"outputs":[{"output_type":"display_data","data":{"text/html":"0.017426273458445","text/markdown":"0.017426273458445","text/latex":"0.017426273458445","text/plain":"[1] 0.01742627"},"metadata":{}}]},{"cell_type":"code","source":"# Calculate Chebyshev's inequality for 'modal_price'\nmean_price <- mean(data$modal_price)\nsd_price <- sd(data$modal_price)\nk <- 2 # Choose the number of standard deviations\nlower_bound <- mean_price - k * sd_price\nupper_bound <- mean_price + k * sd_price\nprop_outliers <- sum(data$modal_price < lower_bound | data$modal_price > upper_bound) / length(data$modal_price)\n\n# Plot the distribution of 'modal_price' with Chebyshev's bounds\nhist(data$modal_price, col = \"skyblue\", main = \"Distribution of modal_price with Chebyshev's Bounds\")\nabline(v = lower_bound, col = \"red\", lwd = 2, lty = 2)\nabline(v = upper_bound, col = \"red\", lwd = 2, lty = 2)\nlegend(\"topright\", legend = c(\"Data\", \"Chebyshev's Bounds\"),\n       col = c(\"skyblue\", \"red\"), lwd = c(1, 2), lty = c(1, 2))\n","metadata":{"execution":{"iopub.status.busy":"2023-07-12T02:30:48.