ource":"# Load the MASS package\nlibrary(MASS)\n\n# Fit log-normal distribution to 'modal_price'\nfit <- fitdistr(data$modal_price, \"lognormal\")\nmean_log <- fit$estimate[1]\nsd_log <- fit$estimate[2]\nmean_price <- exp(mean_log + 0.5 * sd_log^2)\nsd_price <- sqrt((exp(sd_log^2) - 1) * exp(2 * mean_log + sd_log^2))\nmean_price\nsd_price\n","metadata":{"execution":{"iopub.status.busy":"2023-07-12T02:31:27.436477Z","iopub.execute_input":"2023-07-12T02:31:27.438344Z","iopub.status.idle":"2023-07-12T02:31:27.473693Z"},"trusted":true},"execution_count":47,"outputs":[{"output_type":"display_data","data":{"text/html":"<strong>meanlog:</strong> 3068.19792744585","text/markdown":"**meanlog:** 3068.19792744585","text/latex":"\\textbf{meanlog:} 3068.19792744585","text/plain":" meanlog \n3068.198 "},"metadata":{}},{"output_type":"display_data","data":{"text/html":"<strong>sdlog:</strong> 4488.02999384424","text/markdown":"**sdlog:** 4488.02999384424","text/latex":"\\textbf{sdlog:} 4488.02999384424","text/plain":"  sdlog \n4488.03 "},"metadata":{}}]},{"cell_type":"code","source":"# Generate x-axis values for the plot\nx <- seq(min(data$modal_price), max(data$modal_price), length.out = 100)\n\n# Calculate the corresponding log-normal probability density function (pdf)\npdf <- dlnorm(x, meanlog = mean_log, sdlog = sd_log)\n\n# Plot the log-normal distribution\nplot(x, pdf, type = \"l\", lwd = 2, col = \"blue\",\n     xlab = \"modal_price\", ylab = \"Density\",\n     main = \"Fitted Log-Normal Distribution\")\n\n# Add a vertical line for the mean price\nabline(v = mean_price, col = \"red\", lwd = 2, lty = 2)\n\n# Add a legend\nlegend(\"topright\", legend = c(\"Log-Normal PDF\", \"Mean Price\"),\n       col = c(\"blue\", \"red\"), lwd = c(2, 2), lty = c(1, 2))","metadata":{"execution":{"iopub.status.busy":"2023-07-12T02:31:32.463616Z","iopub.execute_input":"2023-07-12T02:31:32.465286Z","iopub.status.idle":"2023-07-12T02:31:32.621642Z"},"trusted":true},"execution_count":48,"outputs