 likelihood estimation.\n","metadata":{}},{"cell_type":"code","source":"# Perform Box-Cox transform on 'modal_price'\nlibrary(MASS)\ntransformed <- boxcox(modal_price ~ 1, data = data)\n\n# Print the lambda parameter\nlambda <- transformed$x[which.max(transformed$y)]\ncat(\"Estimated Lambda:\", lambda, \"\\n\")\n\n# Visualize the Box-Cox transformed values\nplot(transformed$x, transformed$y, type = \"l\",\n     xlab = \"Lambda\", ylab = \"Log Likelihood\",\n     main = \"Box-Cox Transform\")\n\n# Add a vertical line for the estimated lambda\nabline(v = lambda, col = \"red\", lwd = 2, lty = 2)\n","metadata":{"execution":{"iopub.status.busy":"2023-07-12T02:32:08.155035Z","iopub.execute_input":"2023-07-12T02:32:08.156719Z","iopub.status.idle":"2023-07-12T02:32:08.486724Z"},"trusted":true},"execution_count":51,"outputs":[{"name":"stdout","text":"Estimated Lambda: 0.2222222 \n","output_type":"stream"},{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAABaAAAASwCAIAAACCY3qwAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdeViPaf//8atdSSWmZKcY+1giS5GSRBlbyRIxkbXGYLLMSGZuU8OQrGMmlC1l\nuVVqKpKQrGMdkiVi7MpWWj+/P5qf79xlxpbOrno+juM+jtN5Xj5eH/dh6NX1eV9KCoVCAgAA\nAAAAkDNl0QEAAAAAAAA+FAUHAAAAAACQPQoOAAAAAAAgexQcAAAAAABA9ig4AAAAAACA7FFw\nAAAAAAAA2aPgAAAAAAAAskfBAQAAAAAAZI+CAwAAAAAAyB4FBwAAAAAAkD0KDgAAAAAAIHsU\nHAAAAAAAQPYoOAAAAAAAgOxRcAAAAAAAANmj4AAAAAAAALJHwQEAAAAAAGSPggMAAAAAAMge\nBQcAAAAAAJA9Cg4AAAAAACB7FBwAAAAAAED2KDgAAAAAAIDsUXAAAAAAAADZo+AAAAAAAACy\nR8EBAAAAAABkj4IDAAAAAADIHgUHAAAAAACQPQoOAAAAAAAgexQcAAAAAABA9ig4AAAAAACA\n7FFwAAAAAAAA2aPgAAAAAAAAskfBAQAAAAAAZI+CAwAAAAAAyB4FBwAAAAAAkD0KDgAAAAAA\nIHsUHAAAAAAAQPYoOAAAAAAAgOxRcAAAAAAAANmj4AAAAAAAALJHwQEAAAAAAGSPggMAAAAA\nAMgeBQcAAAAAAJA9Cg4AAAAAACB7FBwAAAAAAED2KDgAAAAAAIDsUXAAAAAAAADZo+AAAAAA\nAACyR8EBAAAAAABkj4IDAAAAAADIHgUHAAAAAACQPQoOAAAAAAAgexQcAAAAAABA9ig4AAAA\nAACA7FFwAAAAAAAA2aPgAAAAAAAAskfBAQAAAAAAZI+CAwAAAAAAyB4FBwAAAAAAkD0KDgAA\nAAAAIHsUHAAAAAAAQPYoOAAAAAAAgOxRcAAAAAAAANmj4AAAAAAAALJHwQEAAAAAAGSPggMA\nAAA