Gaussian distribution and z-test:</p></div>\n\n**Non-Gaussian Distribution and Z-test:** Non-Gaussian distribution refers to any probability distribution that is not Gaussian (normal). Non-Gaussian distributions may have different shapes, skewness, or heavier tails compared to the normal distribution. The Z-test is a statistical test that is applicable when the data follows a Gaussian distribution. It compares a sample mean to a known population mean and determines if there is a significant difference.","metadata":{}},{"cell_type":"code","source":"# Perform Shapiro-Wilk test for normality\nshapiro.test(data$modal_price)\n\n# Perform z-test comparing 'modal_price' to a normal distribution\nz <- (mean(data$modal_price) - mean_price) / (sd(data$modal_price) / sqrt(length(data$modal_price)))\np_value <- 2 * (1 - pnorm(abs(z)))\nz\np_value\n","metadata":{"execution":{"iopub.status.busy":"2023-07-12T02:32:30.751896Z","iopub.execute_input":"2023-07-12T02:32:30.753768Z","iopub.status.idle":"2023-07-12T02:32:30.801079Z"},"trusted":true},"execution_count":53,"outputs":[{"output_type":"display_data","data":{"text/plain":"\n\tShapiro-Wilk normality test\n\ndata:  data$modal_price\nW = 0.44254, p-value < 2.2e-16\n"},"metadata":{}},{"output_type":"display_data","data":{"text/html":"<strong>meanlog:</strong> -4.72881564001452","text/markdown":"**meanlog:** -4.72881564001452","text/latex":"\\textbf{meanlog:} -4.72881564001452","text/plain":"  meanlog \n-4.728816 "},"metadata":{}},{"output_type":"display_data","data":{"text/html":"<strong>meanlog:</strong> 2.25833328415526e-06","text/markdown":"**meanlog:** 2.25833328415526e-06","text/latex":"\\textbf{meanlog:} 2.25833328415526e-06","text/plain":"     meanlog \n2.258333e-06 "},"metadata":{}}]},{"cell_type":"code","source":"# Perform Shapiro-Wilk test for normality\nshapiro_result <- shapiro.test(data$modal_price)\n\n# Perform z-test comparing 'modal_price' to a normal distribution\nmean_price <- mean(data$modal_price)\nz <- (mean(da