ution.","metadata":{}},{"cell_type":"code","source":"# Perform chi-square test on categorical variables, e.g., 'state' and 'market'\nchisq.test(table(data$state, data$market))\n","metadata":{"execution":{"iopub.status.busy":"2023-07-12T02:33:02.182507Z","iopub.execute_input":"2023-07-12T02:33:02.185155Z","iopub.status.idle":"2023-07-12T02:33:02.223062Z"},"trusted":true},"execution_count":57,"outputs":[{"name":"stderr","text":"Warning message in chisq.test(table(data$state, data$market)):\n“Chi-squared approximation may be incorrect”\n","output_type":"stream"},{"output_type":"display_data","data":{"text/plain":"\n\tPearson's Chi-squared test\n\ndata:  table(data$state, data$market)\nX-squared = 55950, df = 8125, p-value < 2.2e-16\n"},"metadata":{}}]},{"cell_type":"markdown","source":"# <div style=\"color:white;display:inline-block;border-radius:5px;background-color:#00bd35;font-family:Nexa;overflow:hidden\"><p style=\"padding:10px;color:white;overflow:hidden;font-size:100%;letter-spacing:0.5px;margin:0\"><b>12. </b>  ANOVA test:</p></div>\n\n**ANOVA Test (Analysis of Variance):** The ANOVA test is a statistical test used to determine if there is a significant difference between the means of three or more groups. It assesses whether there is a significant variation among the group means by comparing the variance between groups with the variance within groups. ANOVA is commonly used in experimental studies or when comparing multiple groups simultaneously.\n","metadata":{}},{"cell_type":"code","source":"# Perform ANOVA test comparing 'modal_price' between groups, e.g., 'market'\nmodel <- lm(modal_price ~ market, data)\nanova(model)\n","metadata":{"execution":{"iopub.status.busy":"2023-07-12T02:33:11.076271Z","iopub.execute_input":"2023-07-12T02:33:11.078263Z","iopub.status.idle":"2023-07-12T02:33:11.218178Z"},"trusted":true},"execution_count":58,"outputs":[{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A anova: 2 × 5</caption>\n